import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FuelType, BodyType } from './Models/Car';
import axios from 'axios';

export default function CarAdd() {
  const navigate = useNavigate();

  const [car, setCar] = useState({
    brand: "",
    model: "",
    doorsNumber: 0,
    luggageCapacity: 0,
    engineCapacity: 0,
    fuelType: FuelType.Petrol,
    productionDate: "",
    carFuelConsumption: 0,
    bodyType: BodyType.Sedan
  });

  const handleChange = (
    e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>
  ) => {
    const { name, value } = e.target;

    setCar(prev => ({
      ...prev,
      [name]:
        name === "doorsNumber" ||
        name === "luggageCapacity" ||
        name === "engineCapacity" ||
        name === "carFuelConsumption"
          ? Number(value)
          : value // fuelType i bodyType zostają stringami
    }));
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    try {
      await axios.post("https://localhost:7135/api/Cars", car);
      navigate("/");
    } catch (err) {
      console.error(err);
      alert("Error adding car");
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      style={{
        maxWidth: "400px",
        display: "flex",
        flexDirection: "column",
        gap: "15px",
        padding: "20px"
      }}
    >
      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Brand:</label>
        <input type="text" name="brand" value={car.brand} onChange={handleChange} />
      </div>

      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Model:</label>
        <input type="text" name="model" value={car.model} onChange={handleChange} />
      </div>

      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Doors Number:</label>
        <input type="number" name="doorsNumber" value={car.doorsNumber} onChange={handleChange} />
      </div>

      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Luggage Capacity:</label>
        <input type="number" name="luggageCapacity" value={car.luggageCapacity} onChange={handleChange} />
      </div>

      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Engine Capacity:</label>
        <input type="number" name="engineCapacity" value={car.engineCapacity} onChange={handleChange} />
      </div>

      {/* FUEL TYPE */}
      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Fuel Type:</label>
        <select name="fuelType" value={car.fuelType} onChange={handleChange}>
          {Object.keys(FuelType)
            .filter(key => isNaN(Number(key))) // tylko nazwy enumów
            .map(name => (
              <option key={name} value={FuelType[name as keyof typeof FuelType]}>
                {FuelType[name as keyof typeof FuelType]}
              </option>
            ))}
        </select>
      </div>

      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Production Date:</label>
        <input type="date" name="productionDate" value={car.productionDate} onChange={handleChange} />
      </div>

      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Fuel Consumption:</label>
        <input type="number" name="carFuelConsumption" value={car.carFuelConsumption} onChange={handleChange} />
      </div>

      {/* BODY TYPE */}
      <div style={{ display: "flex", flexDirection: "column" }}>
        <label>Body Type:</label>
        <select name="bodyType" value={car.bodyType} onChange={handleChange}>
          {Object.keys(BodyType)
            .filter(key => isNaN(Number(key)))
            .map(name => (
              <option key={name} value={BodyType[name as keyof typeof BodyType]}>
                {BodyType[name as keyof typeof BodyType]}
              </option>
            ))}
        </select>
      </div>

      <button type="submit">Add</button>
    </form>
  );
}
